import React from 'react';
import "./Dia.css"; 
import { useNavigate } from "react-router-dom";

const Dia = () => {
  const navigate = useNavigate();

  function handleLogin() {
    // Lógica de autenticação do usuário aqui
    navigate("/");
  }

  const date = new Date();
  const dayOfMonth = date.getDate();

  return (
    <div className="container">
      <div className="circle">
        {dayOfMonth}
      </div>
      <div className="rectangle">
        <h2 className="rectangle-title">Título 1</h2>
        <h2 className="rectangle-title">Título 2</h2>
        <div className="rectangle-buttons">
          <button className="rectangle-button">Botão 1</button>
          <button className="rectangle-button">Botão 2</button>
        </div>
        <button className="rectangle-view-all-button" onClick={handleLogin}>Ver Todos</button>
      </div>
    </div>
  );
}

export default Dia;
